import React from "react";
import "./About.css"; // Optional: Add custom CSS if needed

const About = () => {
  return (
    <div className="about-section">
      <h1>About Our Application</h1>
      <p>
        Welcome to our House Essentials application! Here, you can find all the
        necessary items and tools to make your house a perfect home. Whether
        you're looking for furniture, kitchen supplies, or home decor, we offer
        a wide variety of products to meet your needs.
      </p>
      <p>
        Our goal is to provide you with quality items at affordable prices, all
        in one place. Feel free to explore and discover the best products for
        your home.
      </p>
    </div>
  );
};

export default About;
